import React from "react";
import UserList from "../components/UserList";
import { Link } from "react-router-dom";
function userPage() {
  return (
    <div>
      <Link to={`add`} className="button is-success">
        Add New
      </Link>
      <UserList />
    </div>
  );
}

export default userPage;
